import React from 'react'
import { Box } from '@mui/material'
import htmlImg from "../media/htmlImg.png"


const Skills = () => {

  return (
    <Box>
        <Box>
        <img src={htmlImg} alt={htmlImg} style={{maxHeight:"83px"}}/>
        </Box>
    </Box>
  )
}

export default Skills
